/**
 * @name isPercent
 * @author JungHyunKwon
 * @since 2017-12-06
 * @version 1.0.0
 * @param {*} value
 * @return {boolean}
 */
try{!function(){"use strict";window.isPercent=function(t){var r=!1;return"string"==typeof t&&"%"===t.substr(-1)&&(t=t.substring(0,t.length-1))==parseFloat(t,10)&&(r=!0),r}}()}catch(t){console.error(t)}